import React from "react";
import { Link } from "react-router-dom";

const DefaultError = () => {
  return (
    <div>
      <h1>Oops...nothing to see here</h1>
      <p>
        You must <Link to="/">Login</Link> to use this feature.
      </p>
    </div>
  );
};

export default DefaultError;
